El 18 de marzo de 1991, el Boeing 747-200 de Aerolíneas Argentinas, matrícula LV-OEP, realizó un vuelo especial entre Buenos Aires y las Islas Malvinas, fletado por Cruz Roja, para transportar a familiares de fallecidos durante la guerra. Por cuestiones diplomáticas, el avión fue modificado para ese viaje. Se puede notar que en el fuselaje fueron tapadas las banderas argentinas por stickers de Cruz Roja, mientras que el "Aerolíneas Argentinas" fue cambiado a "Aerolíneas  ge in ". Esta operación fue la última, hasta ahora, de un avión perteneciente a la empresa argentina a las Islas Malvinas.
